var animalCotainer = document.getElementById("animal-info");
var res=document.getElementById("result");
var btn = document.getElementById("btn");
var submit = document.getElementById("submit");

btn.addEventListener("click", function(){
    btn.style.display='none';
    setInterval(updateTime, 1000);
    var ourRequest = new XMLHttpRequest();
    ourRequest.open("GET", "https://raw.githubusercontent.com/nikhithaj/Reactjs-project1/main/q.json",true);
    ourRequest.onload = function(){
        //console.log(ourRequest.responseText);
        var ourData = JSON.parse(ourRequest.responseText);
        renderHTML(ourData);
    };
    ourRequest.send();
});

function renderHTML(data){
    var htmlString = "";
    var j =1;
    for(i=0; i<data.length; i++){
        htmlString += "<p id= 'main'>" + j + ".  "+data[i].question +"</p>"+ "<br>";
        htmlString += '<input type="radio" name="'+ j+'" id= option1"'+ '>';
        htmlString += '<label for= option1' +  ">" + data[i].a + "</label"+"<br>";

        htmlString +=  "<br>" +'<input type="radio" name="'+j+'" id= option2"' +'>';
        htmlString += '<label for= option2' + ">" + data[i].b + "</label"+"<br>";

        htmlString += "<br>" + '<input type="radio" name="'+ j+'" id= option3"' +'>';
        htmlString += '<label for= option3' +  ">" + data[i].c + "</label"+"<br>";

        htmlString +=  "<br>" +'<input type="radio" name="'+j+'" id= option4"' +'>';
        htmlString += '<label for= option4' +  ">" + data[i].d + "</label"+"<br>";

        //htmlString += "</p>";
        htmlString += "<hr>";
        j++;  
 
    }
    animalCotainer.insertAdjacentHTML("beforeend", htmlString);
}

submit.addEventListener("click", function(){
    
    localStorage.setItem=("testscore","0");
    if (localStorage.testscore) {
      localStorage.testscore = Number(localStorage.testscore)+1;
    } else {
      localStorage.testscore = 1;
    }
    animalCotainer.style.display='none';
    btn.style.display='none';
    submit.style.display='none';
    result.style.display='';
    document.getElementById("result").innerHTML = "your score is: "+localStorage.testscore;
});

boot.html.keyStrokeInfo:
* {
  padding: 0;
  margin: 0;
  box-sizing: border-box;
}
body {
  font-family: "Lato";
}
.wrapper {
  display: flex;
  justify-content: center;
  align-items: center;
  width: 100vw;
  height: 100vh;
  background-color: pink;
}

.welcome_text {
  width: 400px;
}



.welcome_form input,
.welcome_form button {
  display: block;
  width: 100%;
}

.welcome_form input {
  background-color: transparent;
  color: #fff;
  font-size: 30px;
  text-align: center;
  border: none;
  border-bottom: 1px solid #fff;
  margin-bottom: 15px;
}



.welcome_form button {
  padding: 20px 0;
  border: none;
  border-radius: 100px;
  background-color: #fff;
  color: #341f97;
  font-size: 22px;
  transition: 0.4s all;
}

.welcome_form button:hover {
  box-shadow: 0px 0px 10px 1px rgba(0, 0, 0, 0.2);
  transform: translateY(-5px);
  cursor: pointer;
}

.quiz {
  display: grid;
  grid-template-rows: 60px auto;
  width: 800px;
  height: 500px;
  background-color: #fff;
  box-shadow: 0px 0px 10px 3px rgba(0, 0, 0, 0.3);
  border-radius: 2px;
}

.quiz_header {
  display: flex;
  justify-content: space-between;
  border-top-left-radius: 3px;
  border-top-right-radius: 3px;
  background-color: #fff;
  box-shadow: 0px 2px 5px 1px rgba(0, 0, 0, 0.1);
  z-index: 1;
}
.quiz_body {
  padding: 30px 30px;
}
.quiz_user {
  display: flex;
  align-items: center;
  height: 100%;
  padding-left: 30px;
}

.quiz_timer {
  display: flex;
  align-items: center;
  justify-content: center;
  height: 100%;
  width: 100px;
  background-color: #341f97;
  color: #fff;
}
.quiz_body {
  background-color: #ecf0f1;
}

.option_group {
  list-style-type: none;
  margin: 30px 0;
}

.option {
  display: block;
  width: 300px;
  background-color: #fff;
  margin-bottom: 20px;
  padding: 15px 20px;
  border-radius: 100px;
  border: 2px solid transparent;
  transition: 0.4s all;
}

.option:hover {
  cursor: pointer;
  /* background-color: rgba(255, 255, 255, 0.1); */
  border: 2px solid #341f97;
  color: #341f97;
}
.option.active {
  background-color: #341f97;
  color: #fff;
}
.btn-next {
  border: none;
  padding: 15px 35px;
  background-color: #341f97;
  color: #fff;
  border-radius: 27px;
  transition: 0.4s all;
}

.btn-next:hover {
  cursor: pointer;
  background-color: #fff;
  color: #341f97;
  box-shadow: 0px 0px 10px 1px rgba(0, 0, 0, 0.1);
}

.award_icon {
  display: block;
  font-size: 300px;
  color: rgb(10, 10, 10);
}

.username,
.userpoints,
.usertime {
  color: rgb(8, 8, 8);
  text-align: center;
  margin-top: 15px;
}

